text:
{'text': 'The jewel-shaped dome culminating with star-like apex symbolize unity and act of transition between Allah and his faithful servants. The multi-painted star tinted glass roof symbolize openness. The six minarets symbolize the six tenets of Iman. One of the tallest minarets, stylized from the concept of a jewel-shaped dome culminating with the star and crescent signifies concentration, openness and victory, as well as sovereignty and divinity. It also provides a high point from which to summon the faithful for congregational prayer and is lighted at night and highlights the elevated crescent and star.

The building comprises a basement car park, 18 classrooms, auditorium for 130 people, a computer room and a lift serving all floors.

The mosque is accessible from Bangkit LRT station and nearby bus stops that operate bus numbers 922, 920 and 976.', 'languageCode': 'en'}

